import React from 'react'
import '../Graph/GraphVisualizer'
import '../LinkedList/LinkedListVisualizer'
import '../Tree/TreeVisualizer'
import { Graph } from '../LinkedList/React-D3-LinkedList/Graph'

const Algorithm = (props) => {
    const selectedAlgo = null

    if (props.key == 'LinkedList') {
        selectedAlgo = <LinkedList/>
    } else if (props.key == 'Tree') {
        selectedAlgo = <Tree/>
    } else {
        selectedAlgo = <Graph/>
    }

    return(
        <div>
            {selectedAlgo}
        </div>
    )
}

export default Algorithm
